import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <table
          style={{
            backgroundColor: "#000",
            display: "block",
            color: "#fff",
            fontSize: "3.5vw"
          }}
        >
          <tbody>
            <tr>
              <td>
                <img width="100" src="https://api.nasa.gov/images/logo.png" />
              </td>
              <td>
                <h3>NASA Images</h3>
              </td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default App;
